import React from 'react';

const WordCard = ({ word, isDragging, ...props }) => {
  const opacity = isDragging ? 0.4 : 1;
  const style = { cursor: 'move', opacity };

  return (
    <div style={style} {...props}>
      {word}
    </div>
  );
};

export default WordCard;
